import React from 'react';
import './Table.css';

const TableRow = ({ text, value }) => {
  return (
    <tr>
      <td>{text}</td>
      <td>{value}</td>
    </tr>
  );
};

const Table = () => {
  return (
    <table>
      <thead>Statistics</thead>
      <tbody>
        <TableRow text='Good' value={5} />
        <tr>
          <td>Neutral</td>
          <td>2</td>
        </tr>
        <tr>
          <td>Bad</td>
          <td>3</td>
        </tr>
        <tr>
          <td>Total Feedback</td>
          <td>1</td>
        </tr>
        <tr>
          <td>Average</td>
          <td>1</td>
        </tr>
        <tr>
          <td>Positive Feedback</td>
          <td>3</td>
        </tr>
      </tbody>
    </table>
  );
};

export default Table;
